import React from 'react'

const Add = () => {
  return (
    <div className='form'>
        <h1>Add New Books</h1>
        <input type="text" placeholder='title'/>
        <input type="text" placeholder='desc'/>
        <input type="text" placeholder='price'/>
        <input type="text" placeholder='cov'/>
    </div>
  )
}

export default Add
